var iMaxPageNum=0;function getquerystring(a){var b=new RegExp("(^|&)"+a+"=([^&]*)(&|$)");var c=window.location.search.substr(1).match(b);if(c!=null){return unescape(c[2])}return null}function setmaxpagenum(){iMaxPageNum=document.getElementById("maxPage").innerText}function prepage(){var a=getquerystring("page");if(a==null){a=1}a--;setcurpage(a)}function nextpage(){var a=getquerystring("page");if(a==null){a=1}a++;setcurpage(a)}function setcurpage(a){if(a<1){a=1}else{if(a>iMaxPageNum){a=iMaxPageNum}}var b="?page="+a;window.location.href=b}function initpage(){setmaxpagenum();convert2md()}function convert2md(){var b=document.getElementsByName("markdownContent");for(var a=0;a<b.length;a++){compile(b[a])}}function compile(c){var b=new showdown.Converter();var a=b.makeHtml(c.textContent);c.innerHTML=a};